import React from 'react';
import logo from './logo.svg';
import './App.css';

const bucketListData = [
  {
    title:"Bucket 1",
    bucketId:"123",
    data:[{
      taskId:"123",
      taskName:"Go to Park"
    },
    {
      taskId:"123",
      taskName:"Go to Park"
    },
    {
      taskId:"123",
      taskName:"Go to Park"
    },
    {
      taskId:"123",
      taskName:"Go to Park"
    }
    ]

  },
  {
    title:"Bucket 2",
    bucketId:"123",
    data:[{
      taskId:"123",
      taskName:"Go to Park"
    },
    {
      taskId:"123",
      taskName:"Go to Park"
    },
    {
      taskId:"123",
      taskName:"Go to Park"
    },
    {
      taskId:"123",
      taskName:"Go to Park"
    }
    ]
  }
]

const todoList = (data) => {
  let h = [];
  data.map((item,index)=>{
    h.push(
      <tr key={index}>
      <td>{item.taskName}</td>
    </tr>
    )
  })
  return h;
}
const bucketList = () => {
  let h= [];
   bucketListData.map((item,index)=>{
        h.push(<table key={index}>
          <thead>
            <tr>
              <th> {item.title}</th>
            </tr>
          </thead>
            <tbody>
            {todoList(item.data)}
            </tbody>
        </table>
        )
      })
      return h; 
}
function App() {
  return (
    <div className="container">
      <h1>ToDo List Buckets</h1>
      {bucketList(bucketListData)}
    </div>
  );
}

export default App;
